var $bm_rt;
var S, A, F, R, W, P, i;
S = effect('Speed')('Slider');
A = effect('Amp')('Slider');
F = $bm_div(effect('Freq')('Slider'), 3.6);
R = effect('Resolution')('Slider');
W = effect('Width')('Slider');
P = [];
for (i = 0; i < R; i++) {
    P.push([
        $bm_mul($bm_div(W, R), i),
        $bm_mul(Math.sin($bm_sum($bm_mul(time, S), $bm_div(i, $bm_div(R, F)))), A)
    ]);
}
$bm_rt = createPath(P, [], [], false);

